Bootstrap 是個很好用的 UI 框架，在 Vue 生態系中主要由 Bootstrap Vue 去作銜接，然而在專案中幾乎不會完全使用到 Bootstrap 的所有功能，這時如果把不必要的 css / js 編譯移除，可以降低編譯後專案的大小，這種行為也被稱為 Tree shaking。本篇紀錄了自己在 Nuxt2 中使用 Bootstrap Vue 時，Tree Shaking 的一些步驟。


JS 部份的 Tree Shaking
雖然官方文件有提到 Bootstrap Vue 原生支援 Nuxt2 設定檔的 Tree Shaking 方式，但後來自己測試了一下，若自行引入 SCSS，JS 元件在需要時才透過最原始的方式import引入並註冊，似乎才是最能降低編譯後專案大小的方式。
例如需要使用b-badge元件時，再自行引入並註冊：
<template>
  <b-badge variant="secondary">
    #<slot>{{ tagName }}</slot>
  </b-badge>
</template>

<script>
import { BBadge } from 'bootstrap-vue'
export default {
  components: { BBadge },
  props: {
    tagName: {
      type: String,
      default: '',
    },
  },
}
</script>

透過這種方式使用 Bootstrap Vue，nuxt.config.js中是可以完全不做相關設定的，當然開發時都要自己手動註冊要用的元件，會比較麻煩，但因為這樣我就把這個部落格最後編譯的大小又降低了。

